import React from 'react';
import './App.css';
import Nav from './Nav.js';
import Journal from './Journal.js';
import About from './About.js';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Nav />
      <About />
      <Journal />
    </div>
  );
}

export default App;
